import React from "react";

import logo from "./logo.svg";
import "./App.scss";

function App() {
    return (
        <div className="App">
            <div className="LTbackground">
                <h2 class="test">Hello</h2>
                <li></li>
                <button>Add person</button>
                <p>{Signup()}</p>
            </div>
        </div>
    );
}

const Signup = () => {
    return (
        <div>
            <form>
                <input name="persons"></input>
                <label></label>
            </form>
        </div>
    );
};

export default App;
